"""
    Given a list of numbers and a number k,
    return whether any two numbers from the list add up to k.
"""

def addToK(k, numbers):
    it = 0
    for i in range(len(numbers)-1):
        n = k - numbers[i]
        for j in range(i+1, len(numbers)):
            it += 1
            if  numbers[j] == n:
                return True, len(numbers), it
    return False, len(numbers), it

def addToK2(k, numbers):
    it = 0
    start = 0
    end = len(numbers)-1
    numbers.sort()
    print(numbers)
    while start < end:
        it += 1
        sum = numbers[start] + numbers[end]
        if sum == k:
            return True, len(numbers), it
        elif sum < k:
            start += 1
        else:
            end -= 1
    return False, len(numbers), it

